type PropsType = {
    callback:()=>void
    color?:string
    children?:React.ReactNode
    disabled?:boolean
}

export const SuperButton:React.FC<PropsType> = (props) => {
const {callback,color,children,...otherProps} =props
    const onclickHandler = ()=> {
callback()
    }

    return (
       <button onClick={onclickHandler}>{children}</button>
    );
};


